import React from 'react'
import styled from 'styled-components'

import hugImg from '../assets/article.jpg'

const ArticleContainer = styled.div`
  display: flex;
  align-items: center;
  flex-direction: column-reverse;
  max-height: 600px;
  padding: 16px;

  img {
    width: 100%;
    object-fit: contain;


  }
`

const Text = styled.p`
  color: #384E52;
  font-size: 20px;
`




const ArticleSection = () => {
    return(
        <>
          <ArticleContainer>
            <img alt="kittenhug" className="article-img" src={hugImg} />
            <Text>
              Our goal is to help reunite the  lost pets of 
              the world to their rightful families. 
              Help us help you! <br><a href="description">Pet Postings</a></br>
            </Text>

          </ArticleContainer>

        </>
    )
}

export default ArticleSection
